    public function getProvince($type=1, $id=0)
    {
        $jdApi = new JdApi();
        $allprovince = $jdApi->getJdProvince();
        foreach ($allprovince as $row) {
            $temp[0][$row['id']] = $row['name'];
            $allcitys = $jdApi->getJdCitys($row['id']);
            foreach ($allcitys as $city) {
                $temp[$row['id']][$city['id']] = $city['name'];
                $allcounty = $jdApi->getJdCountys($city['id']);
                foreach ($allcounty as $county) {
                    $temp[$city['id']][$county['id']] = $county['name'];
                }
            }
        }


        //$res = $jdApi->getJdCitys(2);
       // $res = $jdApi->getJdCountys(2824);
        echo json_encode($temp);
    }

    public function getProvince1($type=1, $id=0)
    {
        set_time_limit(0);  //设置程序执行时间
        ignore_user_abort(true);    //设置断开连接继续执行
        header('X-Accel-Buffering: no');    //关闭buffer
        header('Content-type: text/html;charset=utf-8');    //设置网页编码
        ob_start(); //打开输出缓冲控制
        echo 'start.............\n';
        echo ob_get_clean();
        flush();
        $kerperClass = new KerperApi();
        $address = $kerperClass->getJdAddress();
        foreach ($address as $name => $id) {
            echo '第一级++++++++++++++++++'.$name.'\n';
            echo ob_get_clean();
            flush();
            $temp[0][$id] = $name;
            $allcitys = $kerperClass->getJdAddress(2,$id);
            foreach ($allcitys as $name1 => $id1) {
                echo '第二级++++++++++++++++++'.$name.'\n';
                echo ob_get_clean();
                flush();
                $temp[$id][$id1] = $name1;
                $allcounty = $kerperClass->getJdAddress(3,$id1);
                foreach ($allcounty as $name2 => $id2) {
                    echo '第三级++++++++++++++++++'.$name.'\n';
                    echo ob_get_clean();
                    flush();
                    $temp[$id1][$id2] = $name2;
                    $town = $kerperClass->getJdAddress(4,$id2);
                    foreach ($town as $name3 => $id3) {
                        echo '第四级++++++++++++++++++'.$name.'\n';
                        echo ob_get_clean();
                        flush();
                        $temp[$id2][$id3] = $name3;
                    }

                }
            }
        }

        echo  'end........\n';
        echo ob_get_clean();
        flush();

        //$res = $jdApi->getJdCitys(2);
        // $res = $jdApi->getJdCountys(2824);
        file_put_contents('/tmp/address.txt',json_encode($temp));
    }

